import React, { Component } from 'react';
import Child1 from './Child';
class App extends Component {
  componentDidMount(){
  }
  constructor(props){
    super(props)
    this.state={'count':0}
  }
  render() {
    return (<div>
      <div>{"count is: " + this.state.count}</div>
      <Child1 name={"name1"} age={22}></Child1>
      <Child1 name={"name2"} age={33}></Child1>
    </div>);
  }
}

export default App;
